docblock.description:
// Represents the list element from XML Schema as specified by the World Wide Web
// Consortium (W3C). This class can be used to define a simpleType element as a
// list of values of a specified data type.

tag.description:
true if the XPathNavigator is successful moving to the specified namespace;
				false if a matching namespace node was not found, or if the XPathNavigator is not positioned
				on an element node. If false, the position of the XPathNavigator is unchanged.

Returns true if the XPathNavigator is successful moving to the next sibling node;
				false if there are no more siblings, or if the XPathNavigator is currently positioned
				on an attribute node. If false, the position of the XPathNavigator is unchanged.
